textOriginal:
VOTO NO BOLSONARO PORQUE ELE FEZ:
1. Auxílio emergencial na pandemia;
2. Perdoou a dívida do FIES - Financiamento estudantil, para estudantes endividados;
3. Pagou até 75% dos salários para que as empresas não demitissem durante o lockdown.
4. Liberou créditos para a micro e pequenas empresas;
5. Disponibilizou o PIX de graça para todo Brasil;
6. Em 2020 a Selic chegou a 1% obrigando os bancos a renegociar os empréstimos para uma taxa de juros mais baixos! 
7.Concluiu a Transposição de São Francisco; levando água para o Nordeste.
8. Agronegócio;
09. Lucro nas estatais;
10. Fundos de pensão recuperados;
11. Sancionou a lei 14.016 permitindo que restaurantes doem alimentos a pessoas em situação de vulnerabilidade (moradores de rua). O que antes políticos de esquerda proibiram.
12 Lei de proteção e defesa dos animais.
Ele fez isso tudo durante a pandemia, imagine agora sem pandemia o que ele pode fazer pelo Brasil! 
BOLSONARO representa o povo que cansou de ser enganado com o velho modelo da política  brasileira, eu sou parte deste povo!
Cansei de ouvir discursos bonitos, BOLSONARO pode até não falar bonito, mais é ficha limpa e embora muitos não compreendam,  a economia está melhorando. Sei que não é da noite para o dia, mas se parar o que está sendo feito fica pior.
